import Login from "./features/login/Login";
import Banner from "./components/Banner";
import { useEffect, useState } from "react";
import Dashboard from "./features/dashboard/Dashboard";
import { SESSION } from "./constants/AppConstants";
import MainScreen from "./screens/MainScreen";

const App = () => {
  const [token, setToken] = useState();

  const testHandle = () => {
    console.log("1st: " + token);
    setToken(null);
    sessionStorage.setItem(SESSION.SESSION_TOKEN, null);
    console.log("2nd: " + token);
  };

  useEffect(() => console.log("useEffect: " + token), [token]);

  return (
    <div className="App">
      <Banner />
      <MainScreen token={token} setToken={setToken} />
    </div>
  );
};

export default App;
